import React from "react";
const Home = ({search}) => {
    const onSearch = (word) => {
        search(word)
    }

    return(
        <>
            <header className="home">
            <div  className="search">
             <i class="bi bi-search-heart"></i>
             <input className="form-control" placeholder="Search..." type="text" onChange={(e) => onSearch(e.target.value)}/>
            </div>
                <div className='header-content flex align-center justify-center flex-column text-center'>
                    <h1 className='text-white header-title ls-2'>What are your favorite cuisines?</h1>
                    <p className='text-uppercase text-white my-3 ls-1'>personalize your experience</p>
                </div>
            </header>
        </>
    )
}
export default Home;
